import React from 'react';

const Header = () => {
  return (
    <header className="bg-gray-900 text-white border-b-4 border-blue-500">
      <div className="container mx-auto px-6 py-8 flex flex-col md:flex-row items-center justify-between">
        <div className="flex items-center space-x-3 mb-4 md:mb-0">
          <svg className="w-12 h-12 text-blue-400" fill="currentColor" viewBox="0 0 24 24">
            <path d="M12 2a10 10 0 00-7.35 16.83l.68.67h12.34l.68-.67A10 10 0 0012 2zm0 18a8 8 0 01-5.66-2.34l-.43-.42h11.18l-.43.42A8 8 0 0112 20zm-6-8a6 6 0 0112 0h-2a4 4 0 00-8 0H6z" />
          </svg>
          <div>
            <h1 className="text-3xl font-extrabold tracking-wide">DSA Explorer</h1>
            <p className="text-sm text-gray-300">Interactive Learning for Data Structures & Algorithms</p>
          </div>
        </div>
        <nav className="flex flex-wrap gap-4 md:gap-8 text-lg">
          <a href="#dashboard" className="hover:bg-blue-500 px-3 py-1 rounded transition-colors">Dashboard</a>
          <a href="#tutorials" className="hover:bg-blue-500 px-3 py-1 rounded transition-colors">Tutorials</a>
          <a href="#challenges" className="hover:bg-blue-500 px-3 py-1 rounded transition-colors">Challenges</a>
          <a href="#playground" className="hover:bg-blue-500 px-3 py-1 rounded transition-colors">Playground</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
